import React from "react";
import {useNavigate} from 'react-router-dom';

import './StartBtn.css';

const Button = () => {
    const history = useNavigate();
    history('/UploadPage')
    return (
        <React.Fragment>
            <button onClick={history}  className="start-button">START</button>
        </React.Fragment>
    );
};

export default Button;
